import React, { useState } from 'react';
import { format } from 'date-fns';
import TimeRange from '../../components/TimelineSlider/App';
import {
  selectedInterval,
  timelineInterval,
  initialPoints,
} from './datesSource';

const Split = () => {
  const [state, setState] = useState({
    selectedInterval,
  });

  const onChangeCallback = (newSelectedInterval: Date[]) => {
    setState({ selectedInterval: newSelectedInterval });
  };

  return (
    <div>
      <div
        style={{
          width: '80vw',
          /* height: '80vh', */
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          /* height: '20vh', */
          background: '#fff',
          overflowX: 'scroll',
        }}
      >
        <div className="container">
          <div className="info">
            <span>Selected Interval: </span>
            {state.selectedInterval.map((d, i) => (
              <span key={d.getTime()}>{format(d, 'dd MMM, HH:mm')}</span>
            ))}
          </div>

          <TimeRange
            selectedInterval={state.selectedInterval}
            timelineInterval={timelineInterval}
            onChangeCallback={onChangeCallback}
            initialPoints={initialPoints}
          />
        </div>
      </div>
    </div>
  );
};

export default Split;
